import React from "react";

const GameHeader = () => (
    <div className="game-header">
        <h5 className="game-name">Game Name (ID#)</h5>
        <p className="team-greet">Welcome Team 1</p>
        <p className="time"><b>Time Remaining:</b> 00:00:00</p>
    </div>
);

export default GameHeader;
